import React from 'react'
import './Logo.css'
const Logo = () => {
  return (
    <div className='logo'>
      <img src="https://eduport.webestica.com/assets/images/logo.svg" alt="Logo" width="150px"/> 
    </div>
  )
}

export default Logo
